import React from 'react';
import './App.css';




const App = () => {
  return (
    <div className='app-wrapper'>
      <header className='header'>
        <img src = "https://www.freelogodesign.org/Content/img/logo-ex-7.png" alt="Logo"/>
      </header>
      <nav className='nav'>
        <div> Profile </div>
        <div>Messages</div>
      </nav>
      <div className='content'>Main content</div>

    </div>
  );
}

export default App;
